import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';
import { ListUsuariosComponent } from './Components/list-usuarios/list-usuarios.component';
import { DetailUsuarioComponent } from './Components/detail-usuario/detail-usuario.component';
import { NavComponent } from './Components/nav/nav.component';

const routes: Routes = [
  { path: 'nav', component: NavComponent },
  { path: 'listUsuarios', component: ListUsuariosComponent },
  { path: 'detailUser', component: DetailUsuarioComponent },
  { path: '**', redirectTo: 'listUsuarios' }
];

@NgModule({
  imports: [RouterModule.forRoot(routes)],
  exports: [RouterModule]
})
export class AppRoutingModule { }
